// App.js
import React from 'react';
import { BrowserRouter as Router, Routes } from 'react-router-dom';
import Header from './component/Header';
import Page1 from './component/Page1';
import Page2 from './component/Page2';
import SnakeGame from './component/SnakeGame';
import ProtectedRoute from './component/ProtectedRoute';


const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <ProtectedRoute index path="/" element={<Page1 />} roles={['visiteur', 'utilisateur', 'admin']} />
        <ProtectedRoute path="/about" element={<Page2 />} roles={['utilisateur', 'admin']} />
        <ProtectedRoute path="/snakegame" element={<SnakeGame />} roles={['admin']} />  
      </Routes>
    </Router>
  );
};

export default App;
